import React from "react";

const AboutMe = () => 
    <React.Fragment>
        <h1>Steven McStravog</h1>
        <p>I am a passionate and enthusiastic software engineer with several years industrial experience. In addition to my experience as a lead developer, I am also experienced in team and project management, DevOps, quality assurance, and UX design. I therefore have a comprehensive understanding of the full Software Development Life Cycle. I have a deep appreciation for the need to deliver quality software.</p>
    </React.Fragment>;

const About = () => 
    <React.Fragment>
        <AboutMe />
    </React.Fragment>;

export default About;
